class Solution:

    def to_dic(self, arr):
        if arr is not None:
            dic = {}

            for x in arr:
                if x in dic:
                    dic[x] = dic[x] + 1
                else:
                    dic[x] = 1

            return dic

    def canConstruct_2(self, ransomNote, magazine):
        if ransomNote is not None and magazine is not None:
            ransom_dic = self.to_dic(ransomNote)
            magazine_dic = self.to_dic(magazine)

            for x in ransom_dic.items():
                if x[0] not in magazine_dic or (x[0] in magazine_dic and x[1] > magazine_dic[x[0]]):
                    return False
            return True


    # TLE
    def canConstruct(self, ransomNote, magazine):
        if ransomNote is not None and magazine is not None:
            magazine = list(magazine)
            for x in ransomNote:
                index = [i for i, y in enumerate(magazine) if y == x]
                if index:
                    magazine[index[0]] = -1
                else:
                    return False
            return True


s = Solution()
print(s.canConstruct_2("a", "b"))
print(s.canConstruct_2("aa", "ab"))
print(s.canConstruct_2("aa", "aab"))
print(s.canConstruct_2("", ""))
